import React, { useState } from 'react';
import './PropertyForm.css'; // Your custom CSS file
import 'bootstrap/dist/css/bootstrap.min.css'; // Bootstrap CSS
import { Link } from 'react-router-dom';

function PropertyForm() {
  // State variables for structure details
  const [currentMarketValue, setCurrentMarketValue] = useState('');
  const [carpetArea, setCarpetArea] = useState('');
  const [pincode, setPincode] = useState('');
  const [buildingAge, setBuildingAge] = useState('');
  const [propertyEffect, setPropertyEffect] = useState('No');

  // State variables for security measures
  const [security24x7, setSecurity24x7] = useState('No');
  const [isSalaried, setIsSalaried] = useState('No');

  // State variable for tracking validation errors
  const [validationErrors, setValidationErrors] = useState({});

  // Regex pattern for numeric input
  const numericRegex = /^\d+$/;

  // Proceed button click handler
  const handleProceed = () => {
    // Validation check for empty input values and numeric format
    const errors = {};

    if (!currentMarketValue || !numericRegex.test(currentMarketValue)) {
      errors.currentMarketValue = 'Enter a valid number';
    } else if (!/^[0-9]+$/.test(currentMarketValue)) {
      errors.currentMarketValue = 'Only numeric values are allowed';
    }

    if (!carpetArea || !numericRegex.test(carpetArea)) {
      errors.carpetArea = 'Enter a valid number';
    } else if (!/^[0-9]+$/.test(carpetArea)) {
      errors.carpetArea = 'Only numeric values are allowed';
    }

    if (!pincode || !numericRegex.test(pincode)) {
      errors.pincode = 'Enter a valid number';
    } else if (!/^[0-9]+$/.test(pincode)) {
      errors.pincode = 'Only numeric values are allowed';
    }

    // Additional validation for other fields (add similar blocks)

    if (Object.keys(errors).length > 0) {
      // Set validation errors and prevent further action
      setValidationErrors(errors);
      return;
    }

    // Continue with further actions or submit the form
    console.log('Form submitted:', {
      currentMarketValue,
      carpetArea,
      pincode,
      buildingAge,
      propertyEffect,
      security24x7,
      isSalaried,
    });
  };

  return (
    <div className="form-container ">
      <h2>Structure Details</h2>

      <form className="form-container container">
        <div className={`form-group ${validationErrors.currentMarketValue ? 'has-error' : ''}`}>
          <label>Current Market Value of Property:</label>
          <input
            type="text"
            className="form-control"
            placeholder='ex: 150000'
            value={currentMarketValue}
            onChange={(e) => {
              setCurrentMarketValue(e.target.value);
              setValidationErrors({ ...validationErrors, currentMarketValue: '' });
            }}
          />
          {validationErrors.currentMarketValue && (
            <small className="error-text">{validationErrors.currentMarketValue}</small>
          )}
        </div>

        <div className={`form-group ${validationErrors.carpetArea ? 'has-error' : ''}`}>
          <label>Carpet Area/sq.ft:</label>
          <input
            type="text"
            className="form-control"
            placeholder='ex:1300'
            value={carpetArea}
            onChange={(e) => {
              setCarpetArea(e.target.value);
              setValidationErrors({ ...validationErrors, carpetArea: '' });
            }}
          />
          {validationErrors.carpetArea && (
            <small className="error-text">{validationErrors.carpetArea}</small>
          )}
        </div>

        <div className={`form-group ${validationErrors.pincode ? 'has-error' : ''}`}>
          <label>Enter Pincode:</label>
          <input
            type="text"
            className="form-control"
            placeholder='ex: 515001'
            value={pincode}
            onChange={(e) => {
              setPincode(e.target.value);
              setValidationErrors({ ...validationErrors, pincode: '' });
            }}
          />
          {validationErrors.pincode && (
            <small className="error-text">{validationErrors.pincode}</small>
          )}
        </div>

        <div className={`form-group ${validationErrors.buildingAge ? 'has-error' : ''}`}>
          <label>Age of Building:</label>
          <select
            className="form-control"
            value={buildingAge}
            onChange={(e) => setBuildingAge(e.target.value)}
          >
            {[0, 5, 10, 15, 20, 25].map((years) => (
              <option key={years} value={years}>
                {`${years}-${years + 5} years`}
              </option>
            ))}
          </select>
        </div>

        <div className={`form-group ${validationErrors.propertyEffect ? 'has-error' : ''}`}>
          <label>Has your property been affected by floods/earthquake in the past 5 years:</label>
          <select
            className="form-control"
            value={propertyEffect}
            onChange={(e) => setPropertyEffect(e.target.value)}
          >
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </div>

      </form>

      <h2>Security Measures</h2>

      <form className="form-container container">
        <div className={`form-group ${validationErrors.security24x7 ? 'has-error' : ''}`}>
          <label>24*7 Security:</label>
          <select
            className="form-control"
            value={security24x7}
            onChange={(e) => setSecurity24x7(e.target.value)}
          >
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </div>

        <div className={`form-group ${validationErrors.isSalaried ? 'has-error' : ''}`}>
          <label>Are you a salaried individual?:</label>
          <select
            className="form-control"
            value={isSalaried}
            onChange={(e) => setIsSalaried(e.target.value)}
          >
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </div>
      </form>

      <div className=" d-flex justify-content-center">
        <button className="btn btn-primary" onClick={handleProceed}>
          Calculate
        </button>
        <Link to="/formPage" className="btn btn-primary proceed-link ml-4">
          Proceed to Payment
        </Link>
      </div>

    </div>
  );
}

export default PropertyForm;
